import editdistance

'''
reference of gene: 
Covid_a: https://www.ncbi.nlm.nih.gov/nuccore/LR757996
Covid_b: https://www.ncbi.nlm.nih.gov/nuccore/LR757998
Sars_a: https://www.ncbi.nlm.nih.gov/nuccore/NC_004718.3?report=genbank
'''
Covid_a = ''
Covid_b = ''
Sars_a = ''

dist_a = editdistance.eval(f'{Covid_a}', f'{Covid_b}')
print(f'edit distance between Covids: {dist_a}')

percentage_a = int(dist_a) / len(Covid_a)
percentage_b = int(dist_a) / len(Covid_b)
print(f'percentage of change between two covid: ')
print(f'a: {percentage_a} , b: {percentage_b}')

dist_b = editdistance.eval(f'{Sars_a}', f'{Covid_b}')
print(f'edit distance between Sars and Covid: {dist_b}')

percentage_a = int(dist_b) / len(Covid_a)
percentage_b = int(dist_b) / len(Covid_b)
print(f'percentage of change between Sars and Covid: ')
print(f'a: {percentage_a} , b: {percentage_b}')
